import React, { Component } from "react";

class BookingStructure extends Component {
    constructor(props) {
        super(props);

        this.state = {
            moviedates: undefined,
        }
    }

    componentDidMount() {
        this.props.moviedates.map((moviedate) => { moviedate ? console.log("yes") : console.log("no") }
        )
    }


    render() {
        console.log(this.props.moviedates)
        return (
            <tbody>
                <tr>
                    <td>
                        Test
                    </td>
                </tr>
                {this.props.moviedates ?
                    <tr>
                        <td>
                            yes
                        </td>
                    </tr>
                    : "no"}
            </tbody>
        )
    }

}


export default BookingStructure;
